description:
Three unabridged audiobooks: Virals, Seizure, Code

From wiki: 
&quot;The stories, which have elements of science fiction and fantasy, are set in Charleston, South Carolina and the nearby islands and follow the adventures of Tory Brennan (the great-niece of Temperance Brennan, the fictional heroine of Reichs's adult thriller series) and her friends Hiram Stolowitski, Ben Blue, and Shelton Devers&quot;
